	public function attributes($key)
	{
        list($name, $region_no, $province_no, $municipality_no, $no) = self::DATA[$key - 1];

        $municipality = Municipality::find()
            ->alias('m')
            ->joinWith(['region r', 'province p'])
            ->where([
                'r.no' => $region_no,
                'p.no' => $province_no,
                'm.no' => $municipality_no
            ])
            ->groupBy('m.id')
            ->one();

        return [
            'name' => $name,
            'municipality_id' => ($municipality)? $municipality->id: 0,
            'no' => $no,
            'created_at' => new Expression('UTC_TIMESTAMP'),
            'updated_at' => new Expression('UTC_TIMESTAMP'),
        ];
	}
